import React from "react";
import "./Weather.css";
import Forecast from "./components/forecast/Forecast";

class Weather extends React.Component {
  render() {
    return (
      <div className="weather__details">
        { this.props.city && this.props.country && <div>Location: { this.props.city }, { this.props.country}</div> }
        {}
        { this.props.temperature && <div>Temperature: { this.props.temperature }</div> }
        { this.props.id && <div>ID: { this.props.id }</div> }
        { this.props.wind && <div>Wind: { this.props.wind }</div> }
        { this.props.description && <div>Weather: { this.props.description }</div> }
        { this.props.error && <p>{ this.props.error }</p> }
        <Forecast />
      </div>
    )
 }  
}

export default Weather;
